export default async (users: IUserDocument[]) => {
  let i = 0;
  const posts = props.map(
    (post) =>
      new Post({
        ...post,
        author: users[i++ % users.length]._id,
        media: post.media.map((media) => Buffer.from(media, "base64")),
        minMedia: post.minMedia.map((minMedia) =>
          Buffer.from(minMedia, "base64"),
        ),
      }),
  );

  delete posts[0].noComments;

  posts.push(
    new Post({
      content: "Not well",
      author: users[i++ % users.length]._id,
      noComments: true,
      createdAt: dayjs(),
      parent: posts[0]._id,
    }),
  );

  await Post.insertMany(posts);
};
